import {AUTH, LOGOUT} from "../constants/actionsTypes";

const authReducer = (state, action) => {
    switch(action.type){
        case AUTH:
            console.log(action?.data);
            return;
        case LOGOUT:

        default:
    }
};

export default authReducer;
